import React from 'react';
import '../styles/Cards.css';

function Cards({ title, value = { pressure: 'No data available' } }) {
    const pressure = value.pressure || 'No data available';

    return (
        <div>
            <h6>{title}</h6>
            <hr />
            <p>{pressure}</p>
        </div>
    );
}

export default Cards;
